    <header className="header-container">
      <div className="header-container__nav">
    <p>Youtube</p>    
  <ul>

          <li>
            <NavLink
              className={({ isActive }) => (isActive ? "active" : "")}
              to="/"
            >
              {" "}
              Home
            </NavLink>
          </li>
          <li>
            <NavLink
              className={({ isActive }) => (isActive ? "active" : "")}
              to="/about"
            >
              {" "}
              About Us
            </NavLink>
          </li>
          </ul>
          </div>
         </header>
        )
        }

        export default Header;
